import { getDate } from "src/custom-functions";

const LTableBody = (props) => {
  const data = props.body;

  return (
    <>
      {data.data.map((row, i) => {
        return (
          <tr key={i}>
            <td>{row.id}</td>
            <td>{row.title}</td>
            <td>{"row"}</td>
            <td>{getDate(row.created_at)}</td>
            <td>{row.comments_count}</td>
            <td>{row.likes_count}</td>
            <td>{row.likes_count}</td>
          </tr>
        );
      })}
    </>
  );
};
export default LTableBody;
